import '../App.css';

function Login() {
  return (
    <div className="Login">
        <h1>Login page</h1>
        <label>Username</label>
        <input
            type="text"
            onChange={(e) => setUsernameReg(e.target.value)} />

        <label>Password</label>
        <input
            type="password"
            onChange={(e) => setPasswordReg(e.target.value)} />
    </div>
  );
}

export default Login;
